import React from "react";
import { Menu } from "./Home.js";


const AboutUs = () => {
  const rowData = [
    { make: "Toyota", model: "Celica", price: 35000 },
    { make: "Ford", model: "Mondeo", price: 32000 },
    { make: "Porsche", model: "Boxter", price: 72000 },
  ];
  return (
    <div>
      <Menu />
      <h1>About Us Page</h1>
      
    </div>
  );
};

export default AboutUs;
